import React, { Component } from 'react';
import './App.css';
import Navi from './components/Navi/Navi';
import Textbar from './components/Textbar/Textbar';
import Content from './components/Content/Content';


class App extends Component {
  render(){
    return (
      <div className='App'>
        <Textbar id='Textbar'/>
        <Content id='Content'/>
      </div>
    );
  }
}

export default App;
